def collapse(arr)
  arr.each_index do |i|
    l = i
    r = i + 1

    next if arr[l].nil?

    while arr[l].swapcase == arr[r]
      arr[l] = nil
      arr[r] = nil

      break if l.zero? || r == arr.size - 1

      l -= 1
      r += 1
      break if arr[l].nil? || arr[r].nil?
    end
  end

  arr.compact
end

def run_one(arr)
  done = false
  until done
    size = arr.size
    arr = collapse(arr)
    done = arr.size == size
  end
  arr
end

def run(input)
  per_letter = ('a'..'z').each_with_object({}) do |char, h|
    arr = input.gsub(/#{char}/i, '').chars
    arr = run_one(arr)

    h[char] = arr.size
  end

  per_letter.values.min
end

def run_tests
  test_data = [
    ['dabAcCaCBAcCcaDA', 4]
  ]

  test_data.each do |test|
    actual = run(test[0])
    if actual == test[1]
      puts "✅ #{actual} eq #{test[1]}"
    else
      puts "❌ expected #{actual} to eq #{test[1]}"
    end
  end
end

run_tests

data = DATA.read.chomp

out = run(data)
puts "answer: #{out}"

